The power and speed of RDKit, the safety of Rust! A combination of low level C++ bindings and useful high level Rust constructs so you can
 Parse mol/molblocks Normalize Fingerprint  Example:
userdkit::{Properties,ROMol};pubfn main(){letmol=ROMol::from_smile(&#34;c1ccccc1C(=O)NC&#34;).unwrap();letproperties=Properties::new();letcomputed: HashMap&lt;String,f64&gt;=properties.compute_properties(&amp;mol);assert_eq!(*computed.get(&#34;NumAtoms&#34;).unwrap(),19.0);}
